import React from 'react';
import './Navbar.scss';

const Navbar: React.FC = () => {
    return (
        <nav className="navbar-border flex-nowrap navbar navbar-expand-sm navbar-light bg-light fixed-top">
            <div className="container-fluid">
                <button className="navbar-toggler me-2 d-block" type="button" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <a className="navbar-brand text-body-secondary d-none d-md-inline ms-md-2 ms-lg-0" href="/">
                    <img alt="Logo" className="spin" width="18" height="18" src="./logo.png" style={{ animationPlayState: 'paused' }} />
                    <span className="d-none d-lg-inline">Trainer Management System</span>
                </a>
            </div>
        </nav>
    );
};

export default Navbar;
